import React from "react";
import Navbar from '../components/Navbar.jsx';
import { Document, Page } from 'react-pdf'; // Import the necessary components
import resume from "../components/assets/Daphne_Wu_Resume1.pdf"; // Import the PDF file from your assets

const Resume = () => {
  return (
    <div className="bg-gray-100">
      <Navbar />
      <div className="flex justify-center items-center pt-16">
        <div className="relative w-full max-w-4xl h-[calc(100vh-80px)] overflow-auto">
          {/* PDF Viewer */}
          <Document file={resume}>
            {/* Display only the first page of the resume */}
            <Page pageNumber={1} width={1000} />
          </Document>

          {/* Download link */}
          <a
            href={resume}
            download="Daphne_Wu_Resume.pdf"
            className="absolute bottom-10 left-1/2 transform -translate-x-1/2 text-white bg-blue-500 px-6 py-3 rounded-lg hover:bg-blue-600 transition"
          >
            Download Resume
          </a>
        </div>
      </div>
    </div>
  );
};

export default Resume;
